import React, {useState} from 'react';
import {Card, Col, Image, Button, Row } from "react-bootstrap";
import {useNavigate} from "react-router-dom";
import {POSTCARD_ROUTE} from "../utils";


const PostCardItem = ({postCard}) => {
    const navigate = useNavigate()
    return (
        <Col md={3} className="m-2">
            <Card
                onClick={() => navigate(POSTCARD_ROUTE +'/' + postCard.id)}
                style={{width:150, cursor:"pointer"}}
                border={"light"}
            >
                <Image width={150} height={150} src={'http://localhost:5000/' + postCard.img}/>
                <div className="d-flex justify-content-between align-items-center">
                    <div>{postCard.name}</div>
                    <div>{postCard.price} </div>
                </div>
            </Card>
        </Col>
    );
};

export default PostCardItem;
